### {COIN} Staking คืออะไร?
{COIN} Staking คือผลิตภัณฑ์การสเตกแบบออนเชนของ Gate.io ซึ่งช่วยให้ผู้ใช้สามารถสเตก {COIN} และรับรางวัลแบบออนเชนได้อย่างง่ายดายผ่าน {Network}
### กฎการเข้าร่วม {COIN} Staking
 หากคุณสเตก {COIN} ในวันปฏิทินใดวันหนึ่ง (00:00 - 23:59 UTC) รางวัลสเตกจะถูกปล่อยออกในวันที่ D+{IncomeDay}
จำนวนเงินสเตกขั้นต่ำ: {MortgageMin} {COIN}
 ขีดจำกัดการเดิมพัน: {MortgageLimt}
 จำนวนเงินสเตกสูงสุดต่อวัน: {MortgageMax}
 ### กฎการแลกรับ {COIN}
 เนื่องจากคุณเป็นผู้ถือ {COIN} คุณสามารถแลก {COIN} ของคุณได้ตลอดเวลา เงินต้นและผลตอบแทนของคุณจะถูกโอนไปยังบัญชีของคุณในวันที่ D+{RedeemDay} หลังจากส่งคำขอไถ่ถอน
จำนวนเงินแลกขั้นต่ำ: {RedeemMin} {COIN}
 จำนวนเงินแลกสูงสุดต่อวัน: {RedeemMax}

