 ในฐานะผู้ถือ {REWARD} คุณสามารถแลก {REWARD} ของคุณกลับเป็น {COIN} ได้ในอัตราส่วน {ExchangeRate}:1 เงินต้นและผลตอบแทนของคุณจะถูกโอนเข้าบัญชีของคุณทันทีหลังจากส่งคำขอไถ่ถอน
จำนวนเงินแลกขั้นต่ำ: {RedeemMin} {COIN}
 จำนวนเงินแลกสูงสุดต่อวัน: {RedeemMax}
 ### {REWARD} คืออะไร?
{REWARD} คือโทเค็นสเตกกิ้งแบบมีสภาพคล่องที่สร้างผลตอบแทน และเป็นตัวแทนของ {COIN} ที่คุณสเตกในอัตราส่วน 1:{ExchangeRate}

